INSERT INTO `pages` VALUES (17,X'4B6972616C616D61204B6F73756C6C617269','<p>Kiraladiginiz araci yalnizca sozlesme ve teslimat formunda belirtilen kisi/kisiler kullanabilir. Sozlesmede belirtilmeyen ucuncu kisilerin, araci kullanmalari halinde meydana gelebilecek hasarlarda, hicbir hasar guvencesi gecerli degildir. Arac kullanici sayisini arttirabilmek icin subelerimizden, &ldquo;Ek Surucu&rdquo; hizmeti satin alabilirsiniz. Ek surucu; araci kiralayan kisi disinda araci kullanacak biri veya birileri var ise satin alinmak zorundadir. Bir arac icin en fazla 5 adet ek surucu tanimlanabilir. Arac gruplarinda belirlenmis olan yas ve ehliyet yili kosullari dahilinde kiralama yapilabilmektedir. Bu kosullarin saglanamamasi durumunda &ldquo;Genc Surucu&rdquo; hizmet paketi satin alarak bu paket icerigindeki limitler dahilinde kiralama yapabilirsiniz. Genc surucu hizmet paketi &ldquo;Maksimum Guvence&rdquo; hizmetini de icermektedir. Ek Surucu ve Genc Surucu Hizmet ucretlerini rezervasyon merkezimiz ve subelerimizden ogrenebilirsiniz.</p>\r\n\r\n<p><strong>Yas ve Ehliyet Yili Kosullari</strong></p>\r\n\r\n<p>Arac gruplarina bagli minimum yas ve ehliyet yili bilgileri asagidaki tabloda belirtilmistir. Bu kosullari hem kiraci hem de ek surucunun/suruculerin saglamasi gerekmektedir. Ehliyet uzerinde T.C. kimlik numarasi bulunmasi zorunludur. Yeni kimliklerle birlesIk ehliyetler ile kiralama yapilamaz. Yaninizda ehliyetiniz bulunmak zorundadir.</p>\r\n',X'6B6972616C616D612D6B6F73756C6C617269'),(18,X'416E61205361796661','',X'616E612D7361796661'),(19,X'496C65746973696D','<p>Bizimle asagida ki sekillerde iletisime gecebilirsiniz. Sizlere en kisa zamanda donus yapmaya calisacagiz.</p>\r\n\r\n<p><strong>Adres:</strong></p>\r\n\r\n<p>Serasker Cad. No: 1 A Tarihi Kadikoy Cantacilar Sokagi Anafartlalar AVM</p>\r\n\r\n<p><strong>Telefon:</strong></p>\r\n\r\n<p>0555 555 55 55</p>\r\n\r\n<p><strong>E-mail:</strong></p>\r\n\r\n<p>rentacarsivas@gmail.com</p>\r\n\r\n<p><strong>Sosyal Medya Hesaplari:</strong></p>\r\n\r\n<p>facebook: <a href=\"http://www.facebook.com\" target=\"_blank\">www.facebook.com</a><br />\r\ntwitter:&nbsp;<a href=\"http://www.twitter.com\" target=\"_blank\">www.twitter.com</a><br />\r\ninstagram:&nbsp;<a href=\"http://www.instagram.com\" target=\"_blank\">www.instagram.com</a></p>\r\n',X'696C65746973696D'),(20,X'417261636C6172696D697A','',X'617261636C6172696D697A'),(21,X'41726162616C6172696D697A','',X'61726162616C6172696D'),(22,X'4B61736B6F2054656D696E61746C6172696D697A','<p>Rent A Car, Sivas oto, kamyonet ve minibus kullanim tarzlarinda, kisa sureli ve uzun sureli operasyonel kiralama yapilan araclar icin police tanzim edilen urundur.</p>\r\n\r\n<p>Rent a Car Kasko Sigortasi, zorunlu Trafik Sigortasi&rsquo;nin aksine sigorta sahibinin kendi aracini guvence altina almasini saglar ki bu durum Kasko ile Trafik Sigortalari arasindaki en onemli farktir.</p>\r\n\r\n<p>Kasko policenizi ihtiyaciniz olan teminatlar dogrultusunda belirleyebilir, sirketimizin sizin icin hazirlamis oldugu kasko urunleri arasindan ihtiyaciniza uygun kasko policesini secebilirsiniz.</p>\r\n\r\n<p>Istege bagli sigortalar arasinda yer alan Kasko Sigortasi&rsquo;ni sirketimizin avantajli ve kapsamli sigorta policeleriyle birlikte guclendirebilir, araba surme keyfinize guveni ve huzuru ekleyebilirsiniz.</p>\r\n\r\n<p>Kasko sigortasi ile sigortaci, sigortalinin policede belirtilen ve karayolunda kullanma izni olan motorlu ve motorsuz kara araclarindan, romork veya karavanlardan is makinelerinden, lastik tekerlekli traktorler, diger zirai tarim makinelerinden dogan menfaatin asagida belirtilen risklerin gerceklesmesi sonucunda dogrudan ugrayacagi maddi zararlari teminat altina alir.</p>\r\n\r\n<p>a) Aracin karayolunda veya demiryolunda kullanilabilen motorlu, motorsuz araclarla carpismasi,</p>\r\n\r\n<p>b) Gerek hareket gerek durma halinde iken sigortalinin veya araci kullananin iradesi disinda araca ani ve harici etkiler neticesinde sabit veya hareketli bir cismin carpmasi veya aracin boyle bir cisme carpmasi, devrilmesi, dusmesi, yuvarlanmasi gibi kazalar,</p>\r\n\r\n<p>c) Ucuncu kisilerin kotu niyet veya muziplikle yaptiklari hareketler, ile fiil ehliyetine sahip olmayan kisilerin yol acacagi zararlar,</p>\r\n\r\n<p>d) Aracin yanmasi,</p>\r\n\r\n<p>e) Aracin veya arac parcalarinin calinmasi veya calinmaya tesebbus edilmesi</p>\r\n\r\n<p>Genisletilmis Kasko: Yukaridaki teminat gruplarinin tamami ve bu genel sartlarda ek sozlesme ile teminat kapsamina dahil edilebilecek risklerden bir kismi icin teminatin verildigi urundur.</p>\r\n',X'6B61736B6F2D74656D696E61746C6172696D697A'),(23,X'48616B6B696D697A6461','<p>Kisa donem arac kiralama sektorune farkli bir anlayis getirecek olan, yeni nesil arac kiralama slogani ile faaliyete gecen Garenta, Anadolu Grubunun tum sirketleri gibi sektorunde ayrisan, fark yaratan bir anlayisla musterilerine hizmet vermeyi hedefliyor. %100 Anadolu Grubu sermayesi ile kurulan Garenta, global bir marka olma vizyonuna sahip tek Turk arac kiralama markasidir. Marka, is veya ozel maksatla kiralama yapan musterilerin, beklentileri dogrultusunda kurumsalliga sahip ama ayni zamanda da kendi ulkelerine ait ve samimi bulduklari bir marka beklentileri dusunulerek ortaya cikarildi. Garenta markasini, diger global ve kurumsal arac kiralama sirketlerinden ayristiran en onemli ozelligi, tamamen musterilerinin konforu ve mutlulugu dusunulerek gelistirilen teknolojik altyapisidir. Garenta, arac kiralama surecinin her adiminda guven ve destek sagliyor. Musterinin tum beklentilerini goz onunde bulundurarak urun ve hizmetlerini gelistiren Garenta, arac kiralayan musterinin ihtiyac duyabilecegi her konuda teknolojiyi kullanarak, beklentilerin uzerinde hizmet sunmayi hedefliyor.</p>\r\n',X'68616B6B696D697A6461');

